import styled, { keyframes } from 'styled-components'

const magnifierAnimation = keyframes`
    0% {
        transform: rotate(0deg);
    }
    100% {
        transform: rotate(-5deg);
    }
`
const cleanarmAnimation = keyframes`
   0% {
        transform: rotate(0deg);
    }
    100% {
        transform: rotate(25deg);
    } 
`
const brushAnimation = keyframes`
   0% {
        transform: rotate(0deg);
    }
    100% {
        transform: rotate(6deg);
    } 
`

const SVGContainer = styled.div`
    width: 500px;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    margin-left: 2rem;
    align-items: flex-end;
    img {
        opacity: .3;
        width: 70%;        
    }
    svg {
        width: 100%;
    }
    #magnifierArm {
        transform-origin: right;
        transform-box: fill-box;
        animation: ${magnifierAnimation} 2s ease-in-out infinite alternate; 
    }
    #cleanArm {
        transform-origin: left;
        transform-box: fill-box;
        animation: ${cleanarmAnimation} 2s ease-in-out infinite alternate;    
    }
    #brushArm {
        transform-origin: left top;
        transform-box: fill-box;
        animation: ${brushAnimation} 2s ease-in-out infinite alternate; 
    }
    @media (max-width: 950px) {
        width: 450px;
    }
    @media (max-width: 850px) {
        width: 400px;
    }
    @media (max-width: 800px) {
        display: none;
    }
`

